window.bookSummaryJSON = "<p>From award-winning author Julie Berry comes a brand new middle-grade fantasy adventure full of humor and heart, exclusively from Audible.&nbsp;</p> <p>Maeve Merritt chafes at the rigid rules at her London boarding school for “Upright Young Ladies.” When punishment forces her to sort through the trash, she finds a sardine tin that houses a foul-tempered djinni with no intention of submitting to a schoolgirl as his master.&nbsp;&nbsp;</p> <p>Soon an orphan boy from the charitable home next door, a mysterious tall man in ginger whiskers, a disgruntled school worker, and a take-no-prisoners business tycoon are in hot pursuit of Maeve and her magical discovery. It’ll take all of her quick thinking and sass to set matters right. Maeve Merritt is one feisty heroine you won’t soon forget.</p> <p>Julie Berry lives near Los Angeles with her family.<i> The Scandalous Sisterhood of Prickwillow Place</i> is an Odyssey Honor Audiobook, and <i>The Passion of Dolssa</i> is a Printz Honor Title.</p>"; 
